import React from "react"

// ARRAY MAPPING


function Mapping(){
    const object = [
      { name : "AARON", age: "22" , email : "test@email.com"},
      {name : "VINCE", age: "21" , email: "test@email.com"}

    ]

    return(
        <div>
            <h1>Mapping</h1>
            <h2>
                {
                    object.map((item)=>
                    <div>
                        {item.name}
                        {item.age}
                        {item.email}

                    </div>

                    )
                }
            </h2>

            <div>
                {object.lenght}
                {/* ? means "then" "true statement" : "False Statements" */}
                {object.length === 2 ? "You are correct":"You are not correct" }
            </div>
        </div>
    )
}

export default Mapping
